import { initializeApp } from "firebase/app";
import { getAuth, GoogleAuthProvider } from "firebase/auth";
import { getStorage } from "firebase/storage";

const firebaseConfig = {
  apiKey: "AIzaSyB1ap6Q7B464PSZggh_hahUO5KhSWksMlM",
  authDomain: "hack-shark-app.firebaseapp.com",
  projectId: "hack-shark-app",
  storageBucket: "hack-shark-app.appspot.com",
  messagingSenderId: "950727962954",
  appId: "1:950727962954:web:8036fe9a32314c684d91b3"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

export const auth = getAuth(app);

export const storage = getStorage();

export const provider = new GoogleAuthProvider();
export default app;
